description:
This is the story of two families and the war in Yugoslavia. Opening Credits reported that the film is based on a true story. Valentino plays the son of one family, who becomes angry outbreak of war prisoners camp commandant. Selenium and Francesco play a brother and sister from another family. Friends Yorgey (Valentino) before the war, they become enemies with its origin. Pornoblokbaster from Mario Salieri, dedicated to the events that took place during the war in Yugoslavia. Taken in the spirit of the darkest movies entourage Mario Salieri.

